(14, 6, 'tl_article', 128, 1559566279, 'html', 'a:2:{s:5:\"value\";s:0:\"\";s:4:\"unit\";s:2:\"h2\";}', NULL, '', '', '', NULL, '', '', '', '', '', '', '', 'above', '<div class=\"container\">\n	<div class=\"row\">\n		<div class=\"col-lg-8\">\n			<a class=\"img-preview d-block shadow-lg rounded mb-4\" href=\"/previews/creative/\" target=\"_blank\"><img alt=\"Free Bootstrap Creative Theme - Start Bootstrap\" class=\"img-fluid rounded\" src=\"https://startbootstrap.com/assets/img/screenshots/themes/creative.png\">\n			<div class=\"overlay d-flex align-items-center justify-content-center rounded\">\n				<div class=\"btn btn-light\">\n					View Live Preview\n				</div>\n			</div></a>\n			<div class=\"card border-0 shadow mb-4 d-lg-none\">\n				<div class=\"card-body\">\n					<a class=\"btn btn-block btn-primary mb-3 py-3\" href=\"https://github.com/BlackrockDigital/startbootstrap-creative/archive/gh-pages.zip\" onclick=\"if (!window.__cfRLUnblockHandlers) return false; ga(\'send\',\'event\',\'Download\',\'click\',\'Creative\')\" target=\"_blank\"><i class=\"fal fa-download fa-fw\"></i> <span>Free Download</span></a>\n					<hr>\n					<a class=\"btn btn-block btn-outline-primary mb-3\" href=\"/previews/creative/\" target=\"_blank\"><i class=\"far fa-browser fa-fw\"></i> Live Preview</a> <a class=\"btn btn-block btn-outline-github\" href=\"https://github.com/BlackrockDigital/startbootstrap-creative\" target=\"_blank\"><i class=\"fab fa-github fa-fw\"></i> View on GitHub</a>\n				</div>\n			</div>\n			<div class=\"card border-0 shadow mb-4\">\n				<div class=\"card-body\">\n					<h5 class=\"m-0\">Description</h5>\n					<hr>\n					Creative is a one page Bootstrap theme for creatives, small businesses, and other multipurpose use. A modern, flat design style works in unison with rich features and plugins making this theme a great boilerplate for your next Bootstrap based project!\n				</div>\n			</div>\n			<div class=\"card border-0 shadow mb-4\">\n				<div class=\"card-body\">\n					<h5 class=\"m-0\">Features</h5>\n					<hr>\n					<ul class=\"mb-0\">\n						<li>A modern, flat design layout</li>\n						<li>UX friendly navigation with an on scroll style change</li>\n						<li>Custom SASS compiled alongside Bootstrap for deeper customization options</li>\n						<li>Gulp 4 based development environment with a watch task for rapid custom development</li>\n						<li>Intuitive HTML markup with easy to customize content sections</li>\n						<li>Responsive, full page header featuring a background image with overlay and vertically centered content</li>\n						<li>Fully functional portfolio image grid with hover captions and a working lightbox gallery</li>\n					</ul>\n				</div>\n			</div>\n		\n		</div>\n		<div class=\"col-lg-4\">\n			<div class=\"card border-0 shadow mb-4 d-none d-lg-block\">\n				<div class=\"card-body\">\n					<a class=\"btn btn-block btn-primary mb-3 py-3\" href=\"https://github.com/BlackrockDigital/startbootstrap-creative/archive/gh-pages.zip\" onclick=\"if (!window.__cfRLUnblockHandlers) return false; ga(\'send\',\'event\',\'Download\',\'click\',\'Creative\')\" target=\"_blank\"><i class=\"fal fa-download fa-fw\"></i> <span>Free Download</span></a>\n					<hr>\n					<a class=\"btn btn-block btn-outline-primary mb-3\" href=\"/previews/creative/\" target=\"_blank\"><i class=\"far fa-browser fa-fw\"></i> Live Preview</a> <a class=\"btn btn-block btn-outline-github\" href=\"https://github.com/BlackrockDigital/startbootstrap-creative\" target=\"_blank\"><i class=\"fab fa-github fa-fw\"></i> View on GitHub</a>\n				</div>\n			</div>\n			<div class=\"card border-0 shadow mb-4 text-center\">\n				<div class=\"card-body\">\n					<div class=\"small mb-2 font-weight-bold\">\n						Get updates when Creative is improved!\n					</div><a class=\"btn btn-twitter btn-sm btn-block\" href=\"javascript:void(0)\" onclick=\"if (!window.__cfRLUnblockHandlers) return false; window.open(\'https://twitter.com/intent/user?original_referer=[&]region=screen_name[&]screen_name=SBootstrap[&]source=followbutton[&]variant=1.1\', \'twitter\', \'toolbar=no, width=450, height=600\'); return false;\" target=\"_blank\"><i class=\"fab fa-twitter\"></i> Follow @SBootstrap</a>\n				</div>\n			</div>\n			<div class=\"card border-0 shadow mb-4\">\n				<div class=\"card-body\">\n					<div class=\"d-flex justify-content-between small\">\n						<span class=\"font-weight-bold\">License</span> <span><i class=\"fal fa-balance-scale\"></i> <a class=\"font-weight-bold\" href=\"https://github.com/BlackrockDigital/startbootstrap-creative/blob/master/LICENSE\">MIT License</a></span>\n					</div>\n					<hr class=\"my-2\">\n					<div class=\"d-flex justify-content-between small\">\n						<span class=\"font-weight-bold\">Released</span> <span>Apr 8, 2015</span>\n					</div>\n					<hr class=\"my-2\">\n					<div class=\"d-flex justify-content-between small\">\n						<span class=\"font-weight-bold\">Bootstrap Version</span> <span>4.3.1</span>\n					</div>\n					<hr class=\"my-2\">\n					<div class=\"d-flex justify-content-between small\">\n						<span class=\"font-weight-bold\">Last Updated</span> <span>May 29, 2019</span>\n					</div>\n					<hr class=\"my-2\">\n					<div class=\"d-flex justify-content-between small\">\n						<span class=\"font-weight-bold\">Theme Version</span> <span>5.1.6</span>\n					</div>\n				</div>\n			</div>\n			<div class=\"card border-0 shadow mb-4\">\n				<div class=\"card-body\">\n					<h5 class=\"mb-0\">Need something more?</h5>\n					<p class=\"small mb-4\">Try one of these premium Bootstrap themes!</p>\n					<div class=\"row\">\n						<div class=\"col-6 mb-4\">\n							<div class=\"item-preview\">\n								<a class=\"item-preview-img box-shadow-lg d-block\" href=\"https://www.creative-tim.com/product/material-kit-pro/?affiliate_id=101249\" onclick=\"if (!window.__cfRLUnblockHandlers) return false; ga(\'send\',\'event\',\'Affiliate Link\',\'click\',\'Creative Tim - Material Kit Pro\')\" rel=\"nofollow\"><img alt=\"Material Kit Pro - Premium Bootstrap 4 UI Kit\" class=\"img-fluid\" src=\"/assets/img/screenshots/premium/creative-tim/mkp.jpg\"></a>\n							</div>\n						</div>\n						<div class=\"col-6 mb-4\">\n							<div class=\"item-preview\">\n								<a class=\"item-preview-img box-shadow-lg d-block\" href=\"https://www.creative-tim.com/product/material-kit-pro-react/?affiliate_id=101249\" onclick=\"if (!window.__cfRLUnblockHandlers) return false; ga(\'send\',\'event\',\'Affiliate Link\',\'click\',\'Creative Tim - Material Kit Pro React\')\" rel=\"nofollow\"><img alt=\"Material Kit Pro - Premium Bootstrap 4 UI Kit\" class=\"img-fluid\" src=\"/assets/img/screenshots/premium/creative-tim/mkp-react.jpg\"></a>\n							</div>\n						</div>\n						<div class=\"col-6 mb-4\">\n							<div class=\"item-preview\">\n								<a class=\"item-preview-img box-shadow-lg d-block\" href=\"https://www.creative-tim.com/product/now-ui-kit-pro/?affiliate_id=101249\" onclick=\"if (!window.__cfRLUnblockHandlers) return false; ga(\'send\',\'event\',\'Affiliate Link\',\'click\',\'Creative Tim - Now UI Kit Pro\')\" rel=\"nofollow\"><img alt=\"Now UI Kit - Premium Bootstrap 4 UI Kit\" class=\"img-fluid\" src=\"/assets/img/screenshots/premium/creative-tim/nukp.jpg\"></a>\n							</div>\n						</div>\n						<div class=\"col-6 mb-4\">\n							<div class=\"item-preview\">\n								<a class=\"item-preview-img box-shadow-lg d-block\" href=\"https://www.creative-tim.com/product/paper-kit-2-pro/?affiliate_id=101249\" onclick=\"if (!window.__cfRLUnblockHandlers) return false; ga(\'send\',\'event\',\'Affiliate Link\',\'click\',\'Creative Tim - Paper Kit 2 Pro\')\" rel=\"nofollow\"><img alt=\"Paper Kit 2 Pro - Premium Bootstrap 4 UI Kit\" class=\"img-fluid\" src=\"/assets/img/screenshots/premium/creative-tim/pk2p.jpg\"></a>\n							</div>\n						</div>\n					</div><a class=\"btn btn-outline-primary btn-block\" href=\"/buy-bootstrap-themes\">View More Premium Content</a>\n				</div>\n			</div>\n		</div>\n	</div>\n</div>', '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', NULL, '', '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', '', NULL, '', NULL, 0, 0, '', 'none', '', '', NULL, NULL, 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', '', '', '', '', 'ascending', 0, '', '', '', '', 'com_default', '', '', '1', '', 0, 0, 0, 0, 50, 0, 0, 0, 0, '', 0, 0, 50, 50, 0, 0, 0, 0, 'a:3:{i:0;s:2:\"50\";i:1;s:2:\"50\";i:2;s:4:\"crop\";}', '1', '', '', 0, '', '1x1', '100%', '', '1', '1', '', '', '', '', '', '1', '', '', '', 0, '', 0, 0, '0%', 0, '', '', '', '', '', '', '', '', 'rsts_default', 0, '', 0, 'rsts_default');
