(8, 2, 1559052147, 'Bootstrap Header', 'a:2:{s:5:\"value\";s:0:\"\";s:4:\"unit\";s:2:\"h2\";}', 'html', 0, 0, '', '', '', 0, '', '', NULL, NULL, '', '', '', 0, '', NULL, '', 0, 'and', '', 48, 1000, 0, 'simple', '', 'main', 0, '', NULL, '', '', '', '', NULL, NULL, '<header>\n	<div class=\"collapse bg-dark\" id=\"navbarHeader\">\n		<div class=\"container\">\n			<div class=\"row\">\n				<div class=\"col-sm-8 col-md-7 py-4\">\n					<h4 class=\"text-white\">About</h4>\n					<p class=\"text-muted\">Add some information about the album below, the author, or any other background context. Make it a few sentences long so folks can pick up some informative tidbits. Then, link them off to some social networking sites or contact information.</p>\n				</div>\n				<div class=\"col-sm-4 offset-md-1 py-4\">\n					<h4 class=\"text-white\">Contact</h4><!--\n                        <ul class=\"list-unstyled\">\n                            <li><a href=\"#\" class=\"text-white\">Follow on Twitter</a></li>\n                            <li><a href=\"#\" class=\"text-white\">Like on Facebook</a></li>\n                            <li><a href=\"#\" class=\"text-white\">Email me</a></li>\n                        </ul>\n                        -->\n					{{insert_module::13}}\n					\n				</div>\n			</div>\n		</div>\n	</div>\n	<div class=\"navbar navbar-dark bg-dark shadow-sm\">\n		<div class=\"container d-flex justify-content-between\">\n			<a class=\"navbar-brand d-flex align-items-center\" href=\"#\"><img alt=\"Das Logo\" id=\"logo\" src=\"files/themes/default/img/logo.png\"></a> <button aria-controls=\"navbarHeader\" aria-expanded=\"false\" aria-label=\"Toggle navigation\" class=\"navbar-toggler\" data-target=\"#navbarHeader\" data-toggle=\"collapse\" type=\"button\"><span class=\"navbar-toggler-icon\"></span></button>\n			{{insert_module::17}}\n		</div>\n	</div>\n</header>', 3600, NULL, 'rss_default', 3, '', NULL, '', '', '', '', NULL, '', 0, NULL, NULL, '', NULL, '', '', NULL, '', '', 1, 'c