(9, 2, 1558949629, 'Bootstrap Main', 'a:2:{s:4:\"unit\";s:2:\"h2\";s:5:\"value\";s:0:\"\";}', 'html', 0, 0, '', '', '', 0, 'nav_bs', '', NULL, NULL, '', '', '', 0, '', NULL, '', 0, 'and', '', 48, 1000, 0, 'simple', '', 'main', 0, '', NULL, '', '', '', '', NULL, NULL, '<div role=\"main\">\n	<section class=\"jumbotron text-center\">\n		<div class=\"container\">\n			<h1 class=\"jumbotron-heading\">Album example</h1>\n			<p class=\"lead text-muted\">Something short and leading about the collection below—its contents, the creator, etc. Make it short and sweet, but not too short so folks don’t simply skip over it entirely.</p>\n			<p><a class=\"btn btn-primary my-2\" href=\"#\">Main call to action</a> <a class=\"btn btn-secondary my-2\" href=\"#\">Secondary action</a></p>\n		</div>\n	</section>\n	<div class=\"album py-5 bg-light\">\n		<div class=\"container\">\n            <p>Lorem ipsum dolor sit amet consectetur adipisicing elit. Magnam, a? Perspiciatis ab quasi harum quibusdam, deleniti tempora odio consectetur dolor temporibus, animi fugit? Qui soluta aperiam pariatur quam culpa minus! Lorem ipsum dolor sit amet consectetur adipisicing elit. Aperiam, nam. Molestias rerum facere, eligendi, nesciunt recusandae repellendus neque a animi culpa itaque quam, quia aliquid aperiam fuga! Aut, quasi minima?</p>\n		</div>\n	</div>\n</div>', 3600, NULL, 'rss_default', 3, '', NULL, '', '', '', '', NULL, '', 0, NULL, NULL, '', NULL, '', 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', NULL, '', '', 1, 'cal_month', '', 'ascending', 0, 0, 'event_full', 'cal_default', '', 'ascending', '', '', '', '', 'com_default', NULL, 0, '', '', '', '', '', '', '', 'list_default', 'info_default', NULL, 'all_items', '', 0, 'a:2:{i:0;s:4:\"date\";i:1;s:6:\"author\";}', 'news_latest', 'news_month', 0, 'order_date_desc', '', NULL, NULL, NULL, '', NULL, NULL, 'nl_simple', '', '', '1', '', 0, 0, 0, 0, 50, 0, 0, 0, 0, '', 0, 0, 50, 50, 0, 0, 0, 0, 'a:3:{i:0;s:2:\"50\";i:1;s:2:\"50\";i:2;s:4:\"crop\";}', '1', '', '', 0