(1, 6, 1559566294, 'Onepage', 'http://contao.loc/home', 'Onepage About Services Portfolio Contact Search Icons: Search! Search! Your Favorite Source of Free Bootstrap Themes Start Bootstrap can help you build better websites using the Bootstrap framework! Just download a theme and start customizing, no strings attached! Find Out More We\'ve got what you need! Start Bootstrap has everything you need to get your new website up and running in no time! Choose one of our open source, free to download, and easy to use themes! No strings attached! Get Started! At Your Service Sturdy Themes Our themes are updated regularly to keep them bug free! Up to Date All dependencies are kept current to keep things fresh. Ready to Publish You can use this design as is, or you can make changes! Made with Love Is it really open source if it\'s not made with love? Category Project Name Category Project Name Category Project Name Category Project Name Category Project Name Category Project Name Free Download at Start Bootstrap! Download Now! View Live Preview Free Download Live Preview View on GitHub Description Creative is a one page Bootstrap theme for creatives, small businesses, and other multipurpose use. A modern, flat design style works in unison with rich features and plugins making this theme a great boilerplate for your next Bootstrap based project! Features A modern, flat design layout UX friendly navigation with an on scroll style change Custom SASS compiled alongside Bootstrap for deeper customization options Gulp 4 based development environment with a watch task for rapid custom development Intuitive HTML markup with easy to customize content sections Responsive, full page header featuring a background image with overlay and vertically centered content Fully functional portfolio image grid with hover captions and a working lightbox gallery Free Download Live Preview View on GitHub Get updates when Creative is improved! Follow @SBootstrap License MIT License Released Apr 8, 2015 Bootstrap Version 4.3.1 Last Updated May 29, 2019 Theme Version 5.1.6 Need something more? Try one of these premium Bootstrap themes! View More Premium Content Let\'s Get In Touch! Ready to start your next project with us? Give us a call or send us an email and we will get back to you as soon as possible! +1 (202) 555-0149 contact@yourwebsite.com Copyright © 2019 - Start Bootstrap , Free Bootstrap Creative Theme - Start Bootstrap, Material Kit Pro - Premium Bootstrap 4 UI Kit, Now UI Kit - Premium Bootstrap 4 UI Kit, Paper Kit 2 Pro - Premium Bootstrap 4 UI Kit', 16.34, 'fd2f4bc4619d85d727fea9de1dc44580', '', 0x30, 'de-CH');
